import React from 'react';
import styled from '@emotion/styled';

const Btn = styled.input`
    position: absolute;
    top: 5px;
    right: 5px;
`;


const SwitcherTheme = () => {
    return (
        <Btn type="checkbox" class="switch" id="check"/>
    );    
}

export default SwitcherTheme;
